const ItemCard = ({ ItemData }) => {
    console.log(ItemData)
    return (
        <div>
            {ItemData.map(item => (
                    <div className="text-left p-2 m-2"> 
                    <div>{item.card.info.name} - {item.card.info.price / 100}</div>
                    <p>{item.card.info.description}</p>
                    </div>
                    
            ))}
        </div>
    )
}

export default ItemCard;
